package com.mycompany.veterinaria.model;import jakarta.persistence.Column;import jakarta.persistence.Entity;import jakarta.persistence.GeneratedValue;import jakarta.persistence.GenerationType;import jakarta.persistence.Id;import jakarta.persistence.JoinColumn;import jakarta.persistence.OneToOne;import lombok.Getter;import lombok.Setter;@Getter @Setter@Entitypublic class Duenho {    @Id    @GeneratedValue(strategy = GenerationType.SEQUENCE)    @Column(name = "id_duenho")    private  Long idDuenho;    private String dni ;    private String nombreDuenho ;    private String apellidoDuenho;    private String celularDuenho;    public Duenho() {    }    public Duenho(Long idDuenho, String dni, String nombreDuenho, String apellidoDuenho, String celularDuenho) {        this.idDuenho = idDuenho;        this.dni = dni;        this.nombreDuenho = nombreDuenho;        this.apellidoDuenho = apellidoDuenho;        this.celularDuenho = celularDuenho;    }}